" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Chronic intestinal pseudo-obstruction",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?2/26/2474/contributors\">",
