var title_f2_26_2477="Evaluation of sources of sepsis";
var content_f2_26_2477=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F59769&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F59769&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Evaluation of common sources of sepsis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Suspected site",
"       </td>",
"       <td class=\"subtitle1\">",
"        Symptoms/signs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Microbiologic evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Upper respiratory tract",
"       </td>",
"       <td>",
"        Pharyngeal inflammation plus exudate &plusmn; swelling and lymphadenopathy",
"       </td>",
"       <td>",
"        Throat swab for aerobic culture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lower respiratory tract",
"       </td>",
"       <td>",
"        Productive cough, pleuritic chest pain, consolidative auscultatory findings",
"       </td>",
"       <td>",
"        Sputum of good quality, rapid influenza testing, urinary antigen testing (eg, pneumococcus, legionella), quantitative culture of protected brush or bronchoalveolar lavage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Urinary tract",
"       </td>",
"       <td>",
"        Fever, urgency, dysuria, loin pain",
"       </td>",
"       <td>",
"        Urine microscopy showing pyuria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vascular catheters: arterial, central venous",
"       </td>",
"       <td>",
"        Redness or drainage at insertion site",
"       </td>",
"       <td>",
"        Culture of blood (from the catheter and a peripheral site), culture catheter tip (if removed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Indwelling pleural catheter",
"       </td>",
"       <td>",
"        Redness or drainage at insertion site",
"       </td>",
"       <td>",
"        Culture of pleural fluid (through catheter), culture of catheter&nbsp;tip (if removed)&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Wound or burn",
"       </td>",
"       <td>",
"        Inflammation, edema, erythema, discharge of pus",
"       </td>",
"       <td>",
"        Gram stain and culture of draining pus, wound culture not reliable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Skin/soft tissue",
"       </td>",
"       <td>",
"        Erythema, edema, lymphangitis",
"       </td>",
"       <td>",
"        Culture blister fluid or draining pus; role of tissue aspirates not proven",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Central nervous system",
"       </td>",
"       <td>",
"        Signs of meningeal irritation",
"       </td>",
"       <td>",
"        CSF microscopy, protein, glucose, culture, bacterial antigen test",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gastrointestinal",
"       </td>",
"       <td>",
"        Abdominal pain, distension, diarrhea, and vomiting",
"       </td>",
"       <td>",
"        Stool culture for Salmonella, Shigella, and Campylobacter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intraabdominal",
"       </td>",
"       <td>",
"        Specific abdominal symptoms/signs",
"       </td>",
"       <td>",
"        Aerobic and anaerobic culture of percutaneously or surgically drained abdominal fluid collections",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Peritoneal dialysis (PD) catheter",
"       </td>",
"       <td>",
"        Cloudy PD fluid, abdominal pain, fever",
"       </td>",
"       <td>",
"        Cell count and culture of PD fluid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Genital tract",
"       </td>",
"       <td>",
"        <p>",
"         Women: Low abdominal pain, vaginal discharge",
"        </p>",
"        <p>",
"         Men: Dysuria, frequency, urgency, urge incontinence, cloudy urine, prostatic tenderness",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Women: Endocervical and high vaginal swabs onto selective media",
"        </p>",
"        <p>",
"         Men: Urine Gram stain and culture",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Joint",
"       </td>",
"       <td>",
"        Pain, warmth, decreased range of motion",
"       </td>",
"       <td>",
"        Arthrocentesis with cell counts, Gram stain, and culture&nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CSF: cerebrospinal fluid; PD: peritoneal dialysis.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Cohen J, Microbiologic requirements for studies of sepsis. In: Sibbald WJ, Vincent JL (eds), Clinical Trials for the Treatment of Sepsis, Springer-Verlag, Berlin, 1995, p.73.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
