var title_f2_26_2478="QT dispersion mortality normals";
var content_f2_26_2478=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F68172&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F68172&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 510px\">",
"   <div class=\"ttl\">",
"    QT dispersion predicts mortality",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 490px; height: 354px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In a study of 1839 normal subjects followed for mean of 3.7 years, a corrected QT dispersion (QTD) &gt;58 msec was associated with a significantly increased all-cause (p = 0.018) and cardiovascular mortality (p = 0.0016) compared to a QTD &le;58 msec. Compared to a corrected QT interval (QTc) &le;460 msec, a QTc &gt;460 msec was also predictive of all-cause (p&lt;0.0001) and cardiovascular mortality (p&lt;0.014).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Okin PM, Devereux RB, Howard BV, et al. Circulation 2000; 101:61.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f2_26_2478=[""].join("\n");
