var title_f2_26_2479="Hemoglobin oxygen dissociation curve";
var content_f2_26_2479=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F81216&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F81216&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Oxyhemoglobin dissociation curve",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 498px; height: 470px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Depicted here is the oxyhemoglobin dissociation curve for normal adult hemoglobin (Hemoglobin A, solid line). Note that hemoglobin is 50 percent saturated with oxygen at a partial pressure of 27 mmHg (ie, the P50 is 27 mmHg) and is 100 percent saturated at a pO",
"    <sub>",
"     2",
"    </sub>",
"    of approximately 100 mmHg. Depicted here are curves that are \"left-shifted\" (blue line, representing increased oxygen affinity) and \"right-shifted\" (red line, decreased oxygen affinity). The effect of right- or left-shifting of the curve is most pronounced at low oxygen partial pressures. In the examples shown, the right-shifted curve means that hemoglobin can deliver approximately 70 percent of its attached oxygen at a pO",
"    <sub>",
"     2",
"    </sub>",
"    of 27 mmHg. In contrast, the left-shifted hemoglobin can deliver only about 35 percent of its attached oxygen at this pO",
"    <sub>",
"     2",
"    </sub>",
"    . A high proportion of fetal hemoglobin, which has high oxygen affinity, shifts this curve to the left in newborns.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
